  const favs = localStorage.getItem('favs') || []

  return (
    <>
      <h1>Dentists Favs</h1>
      <div className="card-grid">
      {favs.map((item) => (
        <Card/>
      ))}
    </div>
    </>
  );
};

export default Favs;
